DROP TABLE IF EXISTS `cscart_status_descriptions`;
CREATE TABLE `cscart_status_descriptions` (
  `status` char(1) NOT NULL DEFAULT \'\',
  `type` char(1) NOT NULL DEFAULT \'O\',
  `description` varchar(255) NOT NULL DEFAULT \'\',
