  `company_id` int(11) unsigned NOT NULL DEFAULT \'0\',
  `last_login` int(11) unsigned NOT NULL DEFAULT \'0\',
  `timestamp` int(11) unsigned NOT NULL DEFAULT \'0\',
  `password` varchar(32) NOT NULL DEFAULT \'\',
